import styled from "styled-components";

const Container = styled.div`
  width: 100%;
`;
const Contents = styled.div`
  width: 100%;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  gap: 20px;
  padding: 0 200px;
  margin-bottom: 50px;
  span {
    text-align: center;
    font-size: 35px;
    margin-top: 50%;
    color: #00d1fe;
    height: auto;
  }
`;
const Lecture = styled.div`
  p {
    height: fit-content;
    width: 100%;
    font-size: 18px;
    margin: 25px;
  }
`;

export function Education() {
  return (
    <>
      <Container></Container>
    </>
  );
}
